import Content from"../components/list_projects_page/Content";
import Footer from "../components/Footer";
import Header from "../components/Header";


import {Warpper, GlobalStyle } from '../components/list_projects_page/styles';


function App(){
    return (
        <>
        <GlobalStyle/>
        <Warpper>
            <Header/>
            <h1>Projetos e Pesquisas</h1>
            <Content/>
            <Footer/>
        </Warpper>
    </>
    )
}

export default App
